import react, { useState, useEffect, useContext, useRef } from "react";
import { Link } from "react-router-dom"
import Skeleton, { SkeletonTheme } from 'react-loading-skeleton'
import 'react-loading-skeleton/dist/skeleton.css'
import Orderpage from "./Orderpage";
import "./home.css"
import axios from "axios"
import { createContext } from "react";
function Home() {
    const [data, setdata] = useState([]);


    const [loading, setloading] = useState(true)

    useEffect(() => {
        async function fetch() {
            await axios.post("http://localhost:4500/food")
                .then(resp => {
                    setdata(resp.data)
                    console.log(resp.data, "axios")
                    console.log(data)
                    setloading(false)

                }).catch(
                    error => console.log(error)
                )
        }

        fetch()
    }, []);
    console.log(data, "outside")
    const r = useRef("")

    function cardclick(e) {
        console.log("card have been clicked", e)



    }




    return (
        <>
            <div className="nav">  <Link className="homelink" to={{ pathname: "/contact" }}><p className="contact">Contact us</p></Link></div>

            <div className="homebigcon">

                <div className="top">
                    <div className="toptext"><h1>Online <span>restraunt</span></h1><br>
                    </br>
                        <h1><span>F-51,</span>    Pathein,      Myanmar <span>......</span></h1>

                    </div>
                    <img className="topimg" src="https://bolt.eu/static/34a06cc4c628b32af6ce934674c15dd2/ac0ad/desktop.png"></img>
                </div>
                <div className="categorycon">
                    <div className="categorycard"><img className="categoryimg" src="https://static.toiimg.com/thumb/msid-80850219,width-1280,resizemode-4/80850219.jpg"></img></div>
                    <div className="categorycard"><img className="categoryimg" src="https://static.toiimg.com/thumb/msid-80850219,width-1280,resizemode-4/80850219.jpg"></img></div>
                    <div className="categorycard"><img className="categoryimg" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTusRp8HIW2itIj2h-J25xDpHg9gOoj0rSCVA&usqp=CAU"></img></div>
                    <div className="categorycard"><img className="categoryimg" src="https://static.toiimg.com/thumb/msid-80850219,width-1280,resizemode-4/80850219.jpg"></img></div>

                </div>
                <div className="middle">


                    <div className="cardcon">

                        {loading && <div className="c" >

                            <Skeleton count={1} width={300} baseColor=" #efefef " className="g" height={130} />
                            <Skeleton count={1} width={300} baseColor=" #efefef " className="g" height={130} />
                            <Skeleton count={1} width={300} baseColor=" #E5E8E8 " className="g" height={130} />
                            <Skeleton count={1} width={300} baseColor=" #E5E8E8 " className="g" height={130} />
                        </div>
                        }


                        {data && data.map(e => (
                            <div className="productcon">
                                <Link className="link" to={{ pathname: `/orderpage/${e.id}` }}>
                                    <div className="productimage"> <img className="homeproductimg" src={`/${e.image}`} className="image" ></img></div>
                                </Link>
                                <div className="card" ref={r} onClick={() => cardclick(e.id)} key={e.id}>



                                    <p className="producttitle" >{e.name} </p>
                                    <div className="priceandbutton"> <p className="price" > {e.price} <span>ks</span></p>

                                        <div><button className="buybutton">buy</button> <button className="buybutton">Cart</button> </div></div>



                                </div></div>

                        )
                        )}
                    </div>

                </div>

            </div>


        </>
    )
}

export default Home
